import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import {
  BrowserRouter as Router,
  Route,
  BrowserRouter,
  Routes,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route></Route>
      </Routes>
       <Navbar />
       <Footer />
      
       
    </div>
  );
}

export default App;
